import HorizonLine from "../horizontal";

export default function ServerTime() {
  return (
    <div>
      <span style={{ 
        display: "inline-block", 
        width: "256px", 
        height: "97px", 
        border: "1px solid #70BB53",
        backgroundColor: "#ffffff", 
        marginTop: "10px",
        borderRadius: "8px", 
        textAlign: "center", // 텍스트 가운데 정렬
        lineHeight: "97px", // 텍스트 수직 가운데 정렬
        position: "relative" // 하위 요소의 위치를 상대적으로 조정하기 위해 추가
      }}>
        서버시간
        <HorizonLine style={{ position: "absolute", top: "50%", left: "0", right: "0", transform: "translateY(-50%)" }} />
      </span>
    </div>
  );
}
